/*Table structure for table `partnerads` */

DROP TABLE IF EXISTS `partnerads`;

CREATE TABLE `partnerads` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `addedDate` date NOT NULL,
  `adName` varchar(45) NOT NULL,
  `titleAd` varchar(45) NOT NULL,
  `descriptionAd` varchar(45) NOT NULL,
  `partner_Id` int(11) NOT NULL,
  `remark` varchar(45) DEFAULT NULL,
  `isActive` tinyint(1) NOT NULL DEFAULT '1',
  `isApproved` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `FK_Partner_Id_idx` (`partner_Id`),
  CONSTRAINT `FK_Partner_Id` FOREIGN KEY (`partner_Id`) REFERENCES `partners` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `partnerads` */

/*Table structure for table `partners` */

DROP TABLE IF EXISTS `partners`;

CREATE TABLE `partners` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `organizationName` varchar(45) NOT NULL,
  `organizationDescription` text NOT NULL,
  `registrationDate` date NOT NULL,
  `isActive` tinyint(1) NOT NULL DEFAULT '1',
  `profilePicture` varchar(255) DEFAULT NULL,
  `vatNumber` varchar(40) NOT NULL,
  `username` varchar(45) NOT NULL,
  `password` varchar(200) NOT NULL,
  `accountLevel` varchar(20) DEFAULT NULL,
  `email` varchar(40) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

